import { version, Tree, Input } from "antd"
import React from "react";
const { TreeNode } = Tree

const Dragable = () => {
    return <> <Tree
    draggable={true}
    onDragStart={({ event }) => {
      if (event.target.tagName === "INPUT") {
        event.stopPropagation();
        event.preventDefault();
      }
    }}
  >
    <TreeNode
      title={
        <div>
          <Input draggable defaultValue="Can't select this" />
          But you can grab me from here !
        </div>
      }
    />
  </Tree>
  </>
}

export default Dragable
